import { prefix } from '../../globals';
import classnames from 'classnames';

function Header ({ title }) {
  return (
    <header className={`${prefix}-header`}>
      <h1 className={classnames(
          `${prefix}-header__title`,
          `${prefix}-main-heading`)}>
        {title}
      </h1>
    </header>
  );
}

export default Header;
